description:
The Prodigy are an electronic music group formed by Liam Howlett in 1990, in Braintree, Essex, England. Along with The Chemical Brothers, Fatboy Slim, The Crystal Method, and a few other lesser-known acts, they were pioneers of the big beat electronic dance genre. They have sold over 16 million records worldwide which is unequaled in electronic music history. Their music consists of various styles ranging from rave, hardcore and industrial in the early 1990s to alternative rock and big beat with punk vocal elements in later times.





